import ExpenseItem from './ExpenseItem';
import "./Expenses.css";


function Expenses(props) {
  return (
    <div>
      <ExpenseItem 
      title={props.expensesList[0].title} />
      <ExpenseItem expense={props.expensesList[1]} />
      <ExpenseItem expense={props.expensesList[2]} />
      <ExpenseItem expense={props.expensesList[3]} />
    </div>
  );
}

export default Expenses;
